import Link from 'next/link';
import styled from 'styled-components';
import { mediaQuery } from '../utils/style';

const linkStyle = {
  marginRight: 20,
  textDecoration: 'none'
};

const logoStyle = {
    maxWidth: '100%',
    maxHeight: '100%',
    marginLeft: '2px',
};

const HeaderBox = styled.div`
  background-color: #4a4a4a;
  height: 50px;
  width: auto;
`;

const LogoBox = styled.div`
  width: 45px;
  float: left;
  ${mediaQuery.lessThan('medium')`
    width: 20px;
    float: left;
  `}
`;

const fontStyle = {
  color: '#FFF',
  //fontSize: 20,
  marginRight: 20,
}
const FontBox = styled.div`
  height: 50px;
  line-height: 70px;
  font-size: 13px;
  float: right;
  ${mediaQuery.lessThan('medium')`
  font-size: 0px;
  float: right;

  `}
`;

const layoutStyle = {
  //padding: 20,
  border: '1px solid #DDD',
  height: '100%',
  maxWidth: '1200px',
  margin: 'auto',
};
/*
      <Link href="/amazon">
        <a style={linkStyle}><font style={fontStyle}>Amazon</font></a>
      </Link>
      <Link href="/naver">
        <a style={linkStyle}><font style={fontStyle}>Naver</font></a>
      </Link>
      <Link href="/shopee">
        <a style={linkStyle}><font style={fontStyle}>Shopee</font></a>
      </Link>
      <Link href="/">
        <a style={linkStyle}><font style={fontStyle}>Home</font></a>
      </Link>
      <Link href="#about">
        <a style={linkStyle}><font style={fontStyle}>About</font></a>
      </Link>
      <Link href="#feature">
        <a style={linkStyle}><font style={fontStyle}>Features</font></a>
      </Link>
      <Link href="#partners">
        <a style={linkStyle}><font style={fontStyle}>Partners</font></a>
      </Link>
      <Link href="/naver">
            <a style={linkStyle}><font style={fontStyle}>Naver</font></a>
          </Link>
          <Link href="/shopee">
            <a style={linkStyle}><font style={fontStyle}>Shopee</font></a>
          </Link>
*/
const Header = () => (
  <div style={layoutStyle}>
      <HeaderBox>
          <a> <LogoBox><img style={logoStyle} src="../static/logo_2.png"/></LogoBox></a>
        <FontBox>
          <Link href="#mission">
            <a style={linkStyle}><font style={fontStyle}>Mission</font></a>
          </Link>
          <Link href="#feature">
            <a style={linkStyle}><font style={fontStyle}>Intelligence</font></a>
          </Link>
          <Link href="#partners">
            <a style={linkStyle}><font style={fontStyle}>Partners</font></a>
          </Link>
          <Link href="/amazon">
            <a style={linkStyle}><font style={fontStyle}>Product</font></a>
          </Link>
        </FontBox>
      </HeaderBox>


  </div>


);

export default Header;
